<script setup>
// let audio1 = new Audio('data:audio/x-wav;base64,')
// audio1.play()
// const audioContext = new AudioContext()

onMounted(() => {
  InitCanvas()
})
const Play = (event) => {
  audio1.addEventListener('playing', () => {
    console.log('playing')
  })
  audio1.addEventListener('ended', () => {
    console.log('acabo')
  })
}
const Play2 = () => {
  const audioContext = new AudioContext()
  const oscillator = audioContext.createOscillator()
  oscillator.connect(audioContext.destination)
  oscillator.type = 'sawtooth' // sine, square, triangle, sawtooth
  oscillator.start()
  setTimeout( () => {
    oscillator.stop()
  }, 1000)
}

const InitCanvas = () => {
  const container = document.getElementById('container')
  const canvas = document.getElementById('canvas1')
  canvas.width = window.innerWidth
  canvas.height = window.innerHeight

  const ctx = canvas.getContext('2d')
  let audioSource
  let analyser

  container.addEventListener('click', () => {
    const audio1 = document.getElementById('audio1')
    audio1.src = 'data:audio/x-wav;base64,'
    const audioContext = new AudioContext()
    audio1.play()
    audioSource = audioContext.createMediaElementSource(audio1)
    analyser = audioContext.createAnalyser()
    audioSource.connect(analyser)
    analyser.connect(audioContext.destination)
    analyser.fftSize = 64

    const bufferLength = analyser.frequencyBinCount // efect
    const dataArray = new Uint8Array(bufferLength)
    const barWidht = canvas.width / bufferLength
    let barHeigth
    let x // horizontal

    function animate () {
      x = 0
      ctx.clearRect(0, 0, canvas.width, canvas.height)
      analyser.getByteFrequencyData(dataArray) // animation bar
      for (let index = 0; index < bufferLength; index++) {
        barHeigth = dataArray[index]
        ctx.fillStyle = 'white'
        ctx.fillRect(x, canvas.height - barHeigth, barWidht, barHeigth)
        x += barWidht
      }
      requestAnimationFrame(animate)
    }
    animate()
  })
}

</script>

<template lang="">
  <div>
    <TitlePage title="Audio" />
    <button id="button1" type="button" @click="Play()" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
      Play
    </button>
    <button id="button2" type="button" @click="Play2()" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
      Play
    </button>

    <section>
      <div id="container" class="container absolute w-full h-full">
        <canvas id="canvas1" class="absolute w-full h-full"></canvas>
        <audio id="audio1" controls class="w-1/2 block my-8 mx-auto"></audio>
      </div>
    </section>
  </div>
</template>

